import React from 'react'
import Home from "./pages/Home.jsx";
import ProductList from "./pages/ProductList.jsx";
import {  Router,Route } from "react-router-dom"
import {Switch} from 'react-router-dom'


const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/">
          <Home/>
        </Route>
        <Route path="/products">
          <ProductList/>
        </Route>
      </Switch>
    </Router>
  )
};

export default App;
